Animations et médiations scientifiques au sein de l'association Les Petits Débrouillards Occitanie, dont la thématique " Éducation aux transitions écologiques".

Dans leur action, les Petits Débrouillards sont guidés par des convictions et des valeurs éducatives partagées :
- Aider à la découverte de toutes les sciences et technologies, à partir de l’expérimentation ludique et concrète, qui permet de rendre visibles des concepts ou des notions parfois abstraits ;
- Donner le goût de la démarche scientifique faite de curiosité, de recherche de vérité, de liberté d’initiative. Cette démarche expérimentale se réfère au quotidien et invite à prendre conscience de la portée et des limites de ses propres affirmations.
- En favorisant l’implication active dans la vie de la société, développer le sens du partage, de la solidarité et du respect de l’autre dans un esprit d’ouverture au monde ;
-  Entretenir et cultiver la pratique et le plaisir de la connaissance, de l’échange, de la prise de parole et du débat ;
 - Développer l’esprit critique des citoyens et citoyennes en questionnant les sciences et les technologies ainsi que leur rôle dans l’évolution de nos sociétés.

